import React from "react";
import { Placemark } from "react-yandex-maps";
function Point() {
  return (
    <div>
      <Placemark
        key={id}
        geometry={coor}
        options={{
          iconColor: `${iconColorWarehouse}`, // Change color of the marker (red in this case)
          balloonContent: "Your label here", // Add label content
        }}
      />
    </div>
  );
}

export default Point;
